For some constants $a$ and $b,$ let \[f(x) = \left\{
\begin{array}{cl}
ax + b & \text{if } x < 2, \\
8 - 3x & \text{if } x \ge 2.
\end{array}
\right.\]The function $f$ has the property that $f(f(x)) = x$ for all $x.$ What is $a + b?$

The graph of $y=f(x)$ for $-3\le x\le 3$ is shown below. On this interval, what is the range of $f(x)-x$? Express your answer in interval notation.

[asy]
size(150);
real ticklen=3;
real tickspace=2;

real ticklength=0.1cm;
real axisarrowsize=0.14cm;
pen axispen=black+1.3bp;
real vectorarrowsize=0.2cm;
real tickdown=-0.5;
real tickdownlength=-0.15inch;
real tickdownbase=0.3;
real wholetickdown=tickdown;
void rr_cartesian_axes(real xleft, real xright, real ybottom, real ytop, real xstep=1, real ystep=1, bool useticks=false, bool complexplane=false, bool usegrid=true) {

import graph;

real i;

if(complexplane) {

label("$\textnormal{Re}$",(xright,0),SE);

label("$\textnormal{Im}$",(0,ytop),NW);

} else {

label("$x$",(xright+0.4,-0.5));

label("$y$",(-0.5,ytop+0.2));

}

ylimits(ybottom,ytop);

xlimits( xleft, xright);

real[] TicksArrx,TicksArry;

for(i=xleft+xstep; i<xright; i+=xstep) {

if(abs(i) >0.1) {

TicksArrx.push(i);

}

}

for(i=ybottom+ystep; i<ytop; i+=ystep) {

if(abs(i) >0.1) {

TicksArry.push(i);

}

}

if(usegrid) {

xaxis(BottomTop(extend=false), Ticks("%", TicksArrx ,pTick=gray(0.22),extend=true),p=invisible);//,above=true);

yaxis(LeftRight(extend=false),Ticks("%", TicksArry ,pTick=gray(0.22),extend=true), p=invisible);//,Arrows);

}

if(useticks) {

xequals(0, ymin=ybottom, ymax=ytop, p=axispen, Ticks("%",TicksArry , pTick=black+0.8bp,Size=ticklength), above=true, Arrows(size=axisarrowsize));

yequals(0, xmin=xleft, xmax=xright, p=axispen, Ticks("%",TicksArrx , pTick=black+0.8bp,Size=ticklength), above=true, Arrows(size=axisarrowsize));

} else {

xequals(0, ymin=ybottom, ymax=ytop, p=axispen, above=true, Arrows(size=axisarrowsize));

yequals(0, xmin=xleft, xmax=xright, p=axispen, above=true, Arrows(size=axisarrowsize));

}
};
rr_cartesian_axes(-3,3,-3,3);
draw((-3,-3)--(-2,-3),red+1);
draw((-2,-2)--(-1,-2),red+1);
draw((-1,-1)--(0,-1),red+1);
draw((0,0)--(1,0),red+1);
draw((1,1)--(2,1),red+1);
draw((2,2)--(3,2),red+1);
dot((-3,-3),red); dot((-2,-2),red); dot((-1,-1),red); dot((0,0),red); dot((1,1),red); dot((2,2),red); dot((3,3),red);
dot((-2,-3),red,UnFill); dot((-1,-2),red,UnFill); dot((0,-1),red,UnFill); dot((1,0),red,UnFill); dot((2,1),red,UnFill); dot((3,2),red,UnFill);
[/asy]

Automobile license plates for a state consist of four letters followed by a dash and two single digits. How many different license plate combinations are possible if exactly one letter is repeated exactly once, but digits cannot be repeated? [asy]
size(150);
draw((0,0)--(0,5)--(10,5)--(10,0)--cycle);
label("\Huge{CHIC - 03}",(1,3)--(9,3),S);
label("\small\emph{State of Excellence}",(1,1)--(9,1),S);
draw((0.5,3.5)--(0.5,4.5)--(2,4.5)--(2,3.5)--cycle);
label("\footnotesize 5-03",(1.25,4));
draw((9.5,3.5)--(9.5,4.5)--(8,4.5)--(8,3.5)--cycle);
label("\footnotesize FX",(8.75,4));
[/asy]

Each outcome on the spinner below has equal probability. If you spin the spinner three times and form a three-digit number from the three outcomes, such that the first outcome is the hundreds digit, the second outcome is the tens digit and the third outcome is the units digit, what is the probability that you will end up with a three-digit number that is divisible by 4? Express your answer as a common fraction.

[asy]
draw(Circle((0,0),10));
draw((0,0)--(8.7,-5));
draw((0,0)--(-8.7,-5));
draw((0,0)--(0,10));
label("1",(7,7),SW);
label("3",(-7,7),SE);
label("2",(0,-2),S);
draw((0,0)--(3,5),Arrow);
[/asy]

The surface area of a sphere with radius $r$ is $4\pi r^2$. Including the area of its circular base, what is the total surface area of a hemisphere with radius 6 cm? Express your answer in terms of $\pi$.

[asy]

import markers;
size(150);
import geometry;
draw((0,-7)--(0,-1),Arrow);
draw((10,10)--(5,5),Arrow);
label("half of sphere",(10,10),N);
label("circular base",(0,-7),S);

draw(scale(1,.2)*arc((0,0),10,0,180),dashed);
draw(scale(1,.2)*arc((0,0),10,180,360));
draw(Arc((0,0),10,0,180));

[/asy]

A square with sides 6 inches is shown. If $P$ is a point such that the segment $\overline{PA}$, $\overline{PB}$, $\overline{PC}$ are equal in length, and segment $\overline{PC}$ is perpendicular to segment $\overline{FD}$, what is the area, in square inches, of triangle $APB$? [asy]
pair A, B, C, D, F, P;
A = (0,0); B= (2,0); C = (1,2); D = (2,2); F = (0,2); P = (1,1);
draw(A--B--D--F--cycle);
draw(C--P); draw(P--A); draw(P--B);
label("$A$",A,SW); label("$B$",B,SE);label("$C$",C,N);label("$D$",D,NE);label("$P$",P,NW);label("$F$",F,NW);
label("$6''$",(1,0),S);

[/asy]

In the staircase-shaped region below, all angles that look like right angles are right angles, and each of the eight congruent sides marked with a tick mark have length 1 foot.  If the region has area 53 square feet, what is the number of feet in the perimeter of the region? [asy]
size(120);
draw((5,7)--(0,7)--(0,0)--(9,0)--(9,3)--(8,3)--(8,4)--(7,4)--(7,5)--(6,5)--(6,6)--(5,6)--cycle);
label("9 ft",(4.5,0),S);
draw((7.85,3.5)--(8.15,3.5)); draw((6.85,4.5)--(7.15,4.5)); draw((5.85,5.5)--(6.15,5.5)); draw((4.85,6.5)--(5.15,6.5));
draw((8.5,2.85)--(8.5,3.15)); draw((7.5,3.85)--(7.5,4.15)); draw((6.5,4.85)--(6.5,5.15)); draw((5.5,5.85)--(5.5,6.15));
[/asy]

