After the crates have been packed with 200 pipes each, what is the positive difference in the total heights (in cm) of the two packings?

The isosceles trapezoid shown has side lengths as labeled. How long is segment AC? [asy]
unitsize(1.5mm);
defaultpen(linewidth(.7pt)+fontsize(10pt));
dotfactor=3;

pair A=(0,0), B=(21,0), C=(15,8), D=(6,8);
pair[] dots={A,B,C,D};

draw(A--B--C--D--cycle);
dot(dots);
label("A",A,SW);
label("B",B,SE);
label("C",C,NE);
label("D",D,NW);
label("9",midpoint(C--D),N);
label("10",midpoint(D--A),NW);
label("21",midpoint(A--B),S);
label("10",midpoint(B--C),NE);
[/asy]

The truncated right circular cone has a large base radius 8 cm and a small base radius of 4 cm. The height of the truncated cone is 6 cm. How many $\text{cm}^3$ are in the volume of this solid?  [asy]

import olympiad; size(150); defaultpen(linewidth(0.8)); dotfactor=4;

draw(ellipse((0,0),4,1)); draw(ellipse((0,3),2,1/2));

draw((-3.97,.1)--(-1.97,3.1)^^(3.97,.1)--(1.97,3.1));

[/asy]

In the diagram, $ABCD$ and $EFGD$ are squares each of area 16.  If $H$ is the midpoint of both $BC$ and $EF$, find the total area of polygon $ABHFGD$.

[asy]
unitsize(3 cm);

pair A, B, C, D, E, F, G, H;

F = (0,0);
G = (1,0);
D = (1,1);
E = (0,1);
H = (E + F)/2;
A = reflect(D,H)*(G);
B = reflect(D,H)*(F);
C = reflect(D,H)*(E);

draw(A--B--C--D--cycle);
draw(D--E--F--G--cycle);

label("$A$", A, N);
label("$B$", B, W);
label("$C$", C, S);
label("$D$", D, NE);
label("$E$", E, NW);
label("$F$", F, SW);
label("$G$", G, SE);
label("$H$", H, SW);
[/asy]

$\triangle ABC$ and $\triangle DBC$ share $BC$. $AB = 5\ \text{cm}$, $AC = 12\ \text{cm}$, $DC = 8\ \text{cm}$, and $BD = 20\ \text{cm}$. What is the least possible integral number of centimeters in $BC$?

[asy]
size(100); import graph; currentpen = fontsize(10pt);
pair B = (0,0), C = (13,0), A = (-5,7), D = (16,10);

draw(B--A--C--cycle); draw(B--D--C);
label("$A$",A,W); label("$B$",B,W); label("$C$",C,E); label("$D$",D,E);
[/asy]

$ABCD$ is a trapezoid with the measure of base $\overline{AB}$ twice the measure of the base $\overline{CD}$. Point $E$ is the point of intersection of the diagonals. The measure of diagonal $\overline{AC}$ is 11. Find the length of segment $\overline{EC}$. Express your answer as a common fraction.

[asy]

size(200);
pair p1,p2,p3,p4;
p1 = (0,0); p2 = (2.5, 4); p3 = (7.5,4); p4 = (10,0);

draw(p1--p2--p3--p4--cycle);
draw(p1--p3); draw(p2--p4);
label("$A$", p1, SW);
label("$D$", p2, NW);
label("$C$", p3, NE);
label("$B$", p4, SE);
label("$E$", (5,2.5) , S);

[/asy]

Given that
\begin{eqnarray*}&(1)& x\text{ and }y\text{ are both integers between 100 and 999, inclusive;}\qquad \qquad \qquad \qquad \qquad \\     &(2)& y\text{ is the number formed by reversing the digits of }x\text{; and}\\     &(3)& z=|x-y|. \end{eqnarray*}
How many distinct values of $z$ are possible?

The area of the shaded region is 78 square inches. All angles are right angles and all measurements are given in inches. What is the perimeter of the non-shaded region?

[asy]size(101);
filldraw(((0,0)--(0,8)--(10,8)--(10,-2)--(6,-2)--(6,0)--cycle^^(2.5,3)--(2.5,5)--(7.5,5)--(7.5,3)--cycle),gray(.6)+fillrule(1),linewidth(1));
label("$2''$",(5.3,-1),fontsize(10pt));
label("$4''$",(8,-2.7),fontsize(10pt));
label("$2''$",(3.3,4),fontsize(10pt));
label("$10''$",(5,8.7),fontsize(10pt));
label("$10''$",(11,3),fontsize(10pt));[/asy]

