Square $ABCD$ is constructed along diameter $AB$ of a semicircle, as shown. The semicircle and square $ABCD$ are coplanar. Line segment $AB$ has a length of 6 centimeters. If point $M$ is the midpoint of arc $AB$, what is the length of segment $MC$? Express your answer in simplest radical form. [asy]
size(4cm);

dotfactor = 4;
defaultpen(linewidth(1)+fontsize(10pt));

pair A,B,C,D,M;
A = (0,1);
B = (1,1);
C = (1,0);
D = (0,0);
M = (.5,1.5);

draw(A..M..B--C--D--cycle);
draw(A--B);

dot("A",A,W);
dot("M",M,N);
dot("B",B,E);
dot("C",C,E);
dot("D",D,W);

draw(M--C,linetype("0 4"));

[/asy]

Two right triangles, $ABC$ and $ACD$, are joined as shown. Squares are drawn on four of the sides. The areas of three of the squares are 9, 16 and 36 square units. What is the number of square units in the area of the fourth square?

Note that the diagram is not drawn to scale.

[asy]
defaultpen(linewidth(0.7));
draw((0,0)--(12,0)--(12,12)--(0,12)--cycle);
draw((2,12)--(2,14)--(0,14));
draw((0,12)--(0,17)--(12,12));
draw((0,17)--(5.8,31)--(12,12));
draw((5.8,31)--(24.8,37.2)--(31,18.2)--(12,12));
draw((0,17)--(-14,22.8)--(-8.2,36.8)--(5.8,31));
draw((0,12)--(-5,12)--(-5,17)--(0,17));
draw((1.2,16.5)--(1.7,17.7)--(0.5,18.2));
label("$A$",(12,12),SE);
label("$B$",(0,12),SW);
label("$C$",(0,17),NNW);
label("$D$",(5.8,31),N);
label("16",((0,17)+(-14,22.8)+(-8.2,36.8)+(5.8,31))/4);
label("9",(-5/2,6+17/2));
label("36",(6,6));
[/asy]

Let
\[f(a,b) = \left\{
\renewcommand{\arraystretch}{3}
\begin{array}{cl}
\dfrac{ab - a + 2}{2a} & \text{if $a + b \le 3$}, \\
\dfrac{ab - b - 2}{-2b} & \text{if $a + b > 3$}.
\end{array}
\renewcommand{\arraystretch}{1}
\right.\]Find $f(2,1) + f(2,4).$

A circle passes through the point $(0,1),$ and is tangent to the parabola $y = x^2$ at $(2,4).$  Find the center of the circle.

[asy]
unitsize(0.4 cm);

real parab (real x) {
  return(x^2);
}

draw(graph(parab,-3.5,3.5));
draw(Circle((-16/5,53/10),13*sqrt(17)/10));

dot((0,1));
dot("$(2,4)$", (2,4), E);
[/asy]
